from flask_sqlalchemy import SQLAlchemy
db = SQLAlchemy()
defaultBook = "data:image/png;base64,"
def make_db(app, datastore):
    with app.app_context():
        from flask_security.utils import hash_password
        from ..models import Section, Book  

        db.create_all()
        datastore.find_or_create_role(name="admin")
        datastore.find_or_create_role(name="user")
        

        if not datastore.find_user(email="admin@admin.com"):
            admin = datastore.create_user(email="admin@admin.com", password=hash_password("admin"), roles=["admin"])
            admin.name = "Admin"
        # Insert default sections
        sections = ["Fiction", "Non-Fiction", "Science", "History"]
        
        for section_name in sections:
                existing_section = Section.query.filter_by(name=section_name).first()
                if not existing_section:
                    section = Section(name=section_name, description=f"{section_name} books",date_created="2021-09-01",active=1,isRequest=False)
                    db.session.add(section)

        # Insert default books
        books = [
            {"title": "1984", "author": "George Orwell", "section": "Fiction"},
            {"title": "A Brief History of Time", "author": "Stephen Hawking", "section": "Science"},
            {"title": "Sapiens", "author": "Yuval Noah Harari", "section": "History"}
        ]

        for book in books:
            section = Section.query.filter_by(name=book["section"]).first()
            existing_book = Book.query.filter_by(title=book["title"], author=book["author"], section_id=section.id).first()
            if not existing_book:
                new_book = Book(
                    title=book["title"], 
                    author=book["author"], 
                    date_created="dfn", 
                    available=1, 
                    description="jdf", 
                    section_id=section.id,
                    doc=defaultBook
                )
                db.session.add(new_book)

    # Insert default user
        if not datastore.find_user(email="user@user.com"):
            user = datastore.create_user(email="user@user.com", password=hash_password("user"), roles=["user"])
            user.name = "User"

        db.session.commit()
            
        